import React from "react";

const BoardRow = (props) => {
    const { cellValues } = props

    const columns = [1, 2, 3, 4, 5, 6, 7, 8, 9]

    return (
      <tr>
      {columns.map((element) => {
        return (
          <td>
            <input type="text"
            />
          </td>
        )
      })}
      </tr>
    )
}


export default BoardRow
